import React from "react";

export default function placeholder() {
  return (
    <div>
      <div className="placeholder">
        <div className="container mx-auto">
          <div className="list flex">
            <ol className="flex gap-2">
              <li>Home</li>
              <li>
                <span>/</span>
              </li>
              <li>Pemesanan Tiket</li>
            </ol>
          </div>
        </div>
      </div>
    </div>
  );
}
